import React from "react";
import Home from "./components/Home";
import Box from "./components/Three";
import { Canvas } from "react-three-fiber";

function App() {
  return (
    <div className="App">
      <Home />
      <Canvas>
        <Box />
      </Canvas>
    </div>
  );
}

export default App;
